  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Every state will have a Health Insurance
  Marketplace, but each state can choose how it will operate. States can create and
  run their own Marketplace, or have a Marketplace supported by the Department of
  Health and Human Services (HHS). States may also choose to partner with HHS to run
  some functions of their Marketplace.</p>n<p>HHS already has granted conditional
  approval to some states. This means they are on track to have a Marketplace starting
  in October 2013.</p>n<p>The links below take you to websites that describe that
  states Marketplace efforts. The Marketplaces themselves will not begin accepting
  enrollments until October 2013.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
